import React from "react";
import './AboutUs.css';
const MainEvent = () => {
    return (
        <marquee behavior="" className="marquee-container" direction="ltr">
        <div className="links">
          <a href="/converse">Converse</a>
          <a href="/converse">Experts Talks Workshop</a>
          <a href="https://itai.escet.online/MenuLinks/Events/ITAthletics">AIDS Athletics</a>
          {/* <a href="/showtable">Class Time Table</a> */}
        </div>
      </marquee>
    );
}
export default MainEvent;
